import "./intro.scss";

export default function Intro() {
    return (
        <div className='intro' id='intro'>
             <div className="left">
                 <div className="imgContainer">
                     <img src="assets/man.png" alt="" />
                 </div>
             </div>
             <div className="right"></div>
        </div>
    )
}
